import React from "react";
import Ship1 from "../../Icons/sh1.webp";
import Ship2 from "../../Icons/OIP.jpeg";
import Ship3 from "../../Icons/Colnago-C60-Disc-Shimano-Dura-Ace-9070-Di2-Complete-Bike-01.jpg"
import {
    StyledButton,
    StyledText,
    MainWrapper,
    CardWrapper
} from "./Home.styled"
import CardItem from "../../components/CardItem";
const homeText = {
  text:`For aspiring yacht owners looking for a luxury 
        yacht for sale, we have put together a fine 
        selection of luxury yachts and megayachts for 
        sale from all over the world.`
};



const data = [
    {
      title: "Mountain ship Swan",
      text: "Fast and light ship ",
      image:Ship1 ,
      price: 715,
    },
    {
      title: "Mountain ship Trek",
      text:
        "Perfect ship for begginers",
      image: Ship2,
      price: 540,
    },
    {
      title: "Mountain ship Colnago",
      text:
        "The most comfortable and fast ship",
      image: Ship3,
      price: 1610,
    },
  ];
const Home = () =>{
    return(
        <div>
            <MainWrapper>
                <StyledText>
                  <p>{homeText.text}</p>
                  <StyledButton>
                    Detail
                </StyledButton>
                </StyledText>
            </MainWrapper>
            <CardWrapper>

             {data.map(({title,text,image,price},idx)=>(
                <CardItem
                    key= {idx}
                    title={title}
                    text = {text}
                    image= {image}
                    price={price}
                    id={idx}
                />

             ))}
            </CardWrapper>
        </div>
    )
}
export default Home;
